-- | Returns the 'IdentifierType's corresponding to a character.
{-# INLINE identifierTypes #-}
identifierTypes :: Char -> Int
identifierTypes c
    -- Planes 0-3
    | cp < 0x323B0 = lookupIdentifierTypesBitMap cp
    -- Planes 4-13: 0
    | cp < 0xE0000 = 0
    -- Plane 14
    | cp < 0xE01F0 = lookupIdentifierTypesBitMap (cp - 0xADC50)
    -- Default: 0
    | otherwise = 0
    where
    cp = ord c

{-# INLINE lookupIdentifierTypesBitMap #-}
lookupIdentifierTypesBitMap :: Int -> Int
lookupIdentifierTypesBitMap n =
    lookupWord8AsInt data# (
        lookupWord16AsInt offsets1# (
            lookupWord16AsInt offsets2# (
                n `shiftR` 8
            ) + ((n `shiftR` 3) .&. maskOffsets)
        ) + (n .&. maskData)
    )
    where
    maskData = (1 `shiftL` 3) - 1
    maskOffsets = (1 `shiftL` 5) - 1
    !(Ptr data#) = identifierTypesDataBitMap
    !(Ptr offsets1#) = identifierTypesOffsets1BitMap
    !(Ptr offsets2#) = identifierTypesOffsets2BitMap

